import { Row, Container } from "react-bootstrap";
import "../Tweet/Tweet.css";

function Tweet(props) {
  const tweetText = props.text;
  const username = props.username;
  const date = props.dateCreated;

  return (
    <Container fluid className="tweet-container mb-5 w-100">
      <Row className="justify-content-between d-flex">
        <div className="mr-5">{username}</div>
        <div className="mx-auto">{date}</div>
      </Row>
      <Row>{tweetText}</Row>
    </Container>
  );
}
export default Tweet;
